query:
mutation containerIpAddressRangeUpdateFromURL ( $accountId:ID! $updateIpAddressRangeContainerFromUrlInput:UpdateIpAddressRangeContainerFromUrlInput!) {
	container ( accountId:$accountId ) {
		ipAddressRange {
			updateFromURL ( input:$updateIpAddressRangeContainerFromUrlInput   ) {
				container {
					id
					name
					description
					size
					audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
					syncData {
						fileType
						url
						timeInterval
						timeUnit
						notifications {
							subscriptionGroup {
								id
								name
							}
							webhook {
								id
								name
							}
							mailingList {
								id
								name
							}
						}
					}
					syncDataAudit {
						lastSynced
						lastSyncAttempt
						errorMsg
					}
				}
			}
		}
	}	
}
